import React from 'react';
import styles from './Login.module.scss';

const Login = () => {
  return (
    <div className={styles.root}>
      <form>
        <label htmlFor="email">E-mail</label>
        <input
          id='email'
          type="text"
        />
        <label htmlFor="password">Password</label>
        <input
          id='password'
          type="password"
        />
        <button type='submit'>
          Login
        </button>
      </form>
    </div>
  );
};

export default Login;
